import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import ListaChamados from './components/ListaChamados';
import IncluiChamado from './components/IncluiChamado';
import ConsultaChamado from './components/ConsultaChamado';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Login} />
        <Route path="/chamados" exact component={ListaChamados} />
        <Route path="/chamados/novo" component={IncluiChamado} />
        <Route path="/chamados/:id" component={ConsultaChamado} />
      </Switch>
    </Router>
  );
}

export default App;
